plot


Spring has arrived and an array of creatures sleeping in a large tree trunk has awakened from their winter hibernation. This group of unusual creatures, porcupines, possums, a squirrel, a skunk, has formed a family with Verne, a tortoise (voice of Garry Shandling), as the head. They discover that a tall hedge has cut their forest in half and their nut and berry trees are gone. Where are they going to get their food for next winter? Then RJ, an opportunistic raccoon (voice of Bruce Willis), enters the picture. RJ explains to the group that there is a new world called suburbia on the other side of the hedge where humans live. RJ says, &quot;that humans live to eat, rather than eat to live&quot;. Humans throw away more food then they would ever need and put the food in garbage cans. RJ convinces them to go over the hedge to gather food for the winter. Douglas Young (the-movie-guy)

